import React, {Component} from 'react';
import SearchBox from './SearchBox'
import CardList from './CardList'
import {robots} from './robots'

class App extends Component {
	render() {
		return (
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox />
				<CardList robotsInCard={robots}/>
			</div> 
		);
	}
};



export default App;
